INSERT INTO `Award_and_scholarship` VALUES (1,'Chairman Gold Medal','1.The Chairman’s Gold Medal (CGM), to be presented at the Institute Convocation every year, shall be awarded to the student with the best academic performance in the entire graduating B Tech batch. However, a reporting CPI of 9.0 shall be the minimum requirement for the award of the Chairman’s Gold Medal.  \r\n2. The best academic performance shall be judged in terms of the reporting CPI. In the event of a tie in terms of the reporting CPI, the CPI shall be computed to the second decimal place in an attempt to break the tie. However, if there is still a tie, the CGM shall be awarded to as many students as are tied. No attempt shall be made to break the tie by computing the CPI to the third places of decimal and so on. \r\n3. The student receiving the award should not have been involved in any act of indiscipline (except warning under clause 3.2.2.1 of SACS manual) during her/his entire academic programme. \r\n4. The CGM shall be made out of 15 gm of 22 carat gold.'),(2,'Director Gold Medal','1. Director’s Gold Medals (DGMs), to be presented at the Institute Convocation every year, shall be awarded for the best all round performance from among the graduating (a) B Tech batch and (b) M Tech/M Des/PhD students. Students of all disciplines/programme shall be eligible for the award of DGM.  gfhgh\n2. The all-round performance shall be judged by a separate committee appointed by the Chairman Senate. Criteria for short listing the candidates shall be laid down by the committee as per Section 2.4.1. However, a reporting CPI of 8.0 shall be the minimum requirement for the award of the Director’s Gold Medal. \n3. The student receiving the award should not have been involved in any act of indiscipline (except warning under clause 3.2.2.1 of SACS manual) during her/his entire academic programme. \n4. The DGMs shall be made out of 15 gm of 18 carat gold.'),(3,'D&M Proficiency Gold Medal','1. Design and Manufacturing Proficiency Gold Medals are awarded at the time of Institute’s Convocation for the best cross-disciplinary project from among the graduating BTech students and the best cross-disciplinary thesis from among the graduating MTech / MDes / PhD students. Award of design and thythmanufacturing proficiency gold medal (D&MPGM) is applicable for BTP/PBI or Design and Fabrication projects. \n2. The award of D&M Proficiency Gold Medals shall be decided by the separate committee appointed for this purpose by the Chairman, Academic Senate which will seek applications after finalizing a short listing criterion. After short listing of applications, the committee shall call all the short listed applicants for a presentation/demonstration.   \n3. D&M Proficiency Gold Medals may not be awarded if projects/theses submitted for the award are found to have an inadequate cross-disciplinary content. \n4. The D&M Proficiency Gold Medals shall be made out of 15 gm of 18 carat gold. \n5. In the event of a group being awarded the best cross-disciplinary project, each individual student shall be awarded the medal provided the student satisfies following eligibility criteria for the award. (a) The students must have at least a CPI of 6.5. (b) At the time of application, there should not be any backlog of courses for the student. (c) Student’s grade in the project must be A, A+ or S.”'),(4,'Academic Performance Proficiency Silver Medal','1. Academic Performance Proficiency Silver Medals shall be awarded at the time of Institute’s Convocation for the outstanding academic performance to the best graduating student of each discipline of the B Tech program. \r\n2. The recipient(s) of the Chairman’s Gold Medal shall be eligible for the award of the Academic Performance Proficiency Medal. \r\n3. The award of a Proficiency Medal may not be made for a particular discipline if the total number of graduating students for that discipline is less than five. \r\n4. The award of a Proficiency Medal may not be made for a particular discipline if the highest CPI among the graduating students of that discipline is less than 8.5. \r\n5. In the event of a tie, in terms of the reporting CPI, the medal shall be awarded to all the students, so tied, with no effort being made to break the tie. \r\n6. Academic Performance Proficiency Medals shall be made out of 15 gm silver'),(5,'IIITDM Proficiency Prizes','1.The Chairman’s Gold Medal (CGM), to be presented at the Institute Convocation every year, shall be awarded to the student with the best academic performance in the entire graduating B Tech batch. However, a reporting CPI of 9.0 shall be the minimum requirement for the award of the Chairman’s Gold Medal.  \n2. The best academic performance shall be judged in terms of the reporting CPI. In the event of a tie in terms of the reporting CPI, the CPI shall be computed to the second decimal place in an attempt to break the tie. However, if there is still a tie, the CGM shall be awarded to as many students as are tied. No attempt shall be made to break the tie by computing the CPI to the third places of decimal and so on. \n3. The student receiving the award should not have been involved in any act of indiscipline (except warning under clause 3.2.2.1 of SACS manual) during her/his entire academic programme. \n4. The CGM shall be made out of 15 gm of 22 carat gold.'),(6,'Director Silver Medal Cultural','1. Director’s Silver Medals (DSMs) shall be presented at the time of Institute’s Convocation for the outstanding performance in Cultural activities from among the graduating undergraduate and postgraduate students. \n2. The award of DSMs shall be decided by the separate  committee appointed for this purpose by the Chairman, Academic Senate. The committee shall lay down the criteria for short listing the candidates before calling them for an interview. \n3.  Director’s Silver Medals shall be made out of 15 gm silver.\nTesting the edit feature.'),(7,'Notional Prizes','1. Notional Prizes and Certificates of Merit shall be awarded to 7 percent of the students of each undergraduate and postgraduate batch for excellent academic performance in an academic year. In the first two years, the 7 percent shall be calculated for the entire B Tech batch, whereas for the third year the award shall be made for each discipline taking into account their respective strengths. For PG student, the 7 percent shall be calculated based on the academic performance of the first two semester of PG program for each discipline taking into account their respective strengths. \r\n2. The Notional Prize may be awarded to a student irrespective of whether he/she is a recipient of any other scholarship or not. \r\n3. The value of the Notional Prize shall be as prescribed from time to time, by the Ministry of Human Resources and Development.\r\n4. In calculating the actual number of awards to be made in any year or for any department, any fraction shall usually be rounded off to the next integer. However, this may not be done in those cases where there is a significant difference in the performance level of the students. \r\n5. The award shall, in principle, be given only on the basis of the annual performance. (By dividing credits earned in two regular semester with total credits for two semester) Further the award may not be made for any department having student strength of less than 5. It may also not be made if the highest CPI for any department is considerably lower than the performance levels at which the award is being made for other departments or minimum CPI limit of 8.5.'),(8,'Mcm','Eligibility Requirements : 1. Minimum CPI : Minimum reporting CPI (6.0 for GENERAL Category Students and 5.5 for SC/ST students) at the end of previous semester.\n2. Family annual income certificate (Form A or Form B or Form C) : The parental/guardian family annual income of a student and from all sources in the preceeding financial year must not exceed 2.50 Lakhs. Please note that income certificate is properly sealed and signed bu Competent Revenue authority of Government of India. (Normally issued by District Magistrate / Tehsildat in original). Please enclosed the parental/guardian family income in the prescribed format(A,B,or C) as  applicable.\n\nFor more details refer to Institute SPACS manual.ifkhfuguthbuhrt'),(9,'Director Silver Medal Games and Sports','\"1. Director’s Silver Medals (DSMs) shall be presented at the time of Institute’s Convocation for the outstanding performance in Games & Sports activities from among the graduating undergraduate and postgraduate students. \r\n2. The award of DSMs shall be decided by the separate committee appointed for this purpose by the Chairman, Academic Senate. The committee shall lay down the criteria for short listing the candidates before calling them for an interview. \r\n3.  Director’s Silver Medals shall be made out of 15 gm silver. \"');
